import { NavLink } from 'react-router-dom';
import styles from './NavbarStyle.module.css';
import logo from '../../assets/img/logo.png';
import { Navbar as BootstrapNavbar, Nav, Container } from 'react-bootstrap';
import { useState } from 'react';

const sections = [
  { id: 'Inicio', name: 'INICIO' },
  { id: 'Productos', name: 'NUESTROS PRODUCTOS' },
  { id: 'QuienesSomos', name: 'QUIENES SOMOS' },
  { id: 'NuestrosClientes', name: 'NUESTROS CLIENTES' },
  { id: 'contacto', name: 'CONTACTO' }
];

const Navbar = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  return (
    <BootstrapNavbar expand="lg" bg="dark" variant="dark" className={styles.navbar}>
      <Container>
        <BootstrapNavbar.Brand href="/">
          <img src={logo} alt="Logo" className={styles.logo} />
        </BootstrapNavbar.Brand>

        <BootstrapNavbar.Toggle 
          aria-controls="basic-navbar-nav"
          onClick={() => setMenuOpen(!menuOpen)}
        />

        <BootstrapNavbar.Collapse id="basic-navbar-nav" className={menuOpen ? "show" : ""}>
          <Nav className="ms-auto">
            {sections.map((section) => (
              <Nav.Link
                key={section.id}
                as={NavLink}
                to={`/#${section.id}`}
                className={styles.navLink}
                onClick={() => setMenuOpen(false)}
              >
                {section.name}
              </Nav.Link>
            ))}
          </Nav>
        </BootstrapNavbar.Collapse>
      </Container>
    </BootstrapNavbar>
  );
};

export default Navbar;
